import React, { Component } from 'react';

export default class UsersTableHeader extends Component {
   render() {
      return (
         <div>
            <thead>
               <tr>
                  <th>User Name</th>
                  <th>Role</th>
                  <th>Role</th>
                  <th>Action</th>
               </tr>
            </thead>
         </div>
      );
   }
}
